/**
 * Sets the username and password used.
 * @param {string} user - the email address/username of the thriftbooks account being used.
 * @param {string} pass - the password for the thriftbooks account being used. 
 */ 
ThriftbooksAPI.prototype.setAccount = function(user, pass) {
	var self = this;
	this.loginRequest.form.ctl00$ContentPlaceHolder1$UserCtrlExsUser$txtEmailAddress = user;
	this.loginRequest.form.ctl00$ContentPlaceHolder1$UserCtrlExsUser$txtPassword = pass;
}

ThriftbooksAPI.prototype.setSearchISBN = function(isbn) {
	this.searchRequest.form.ctl00$UserCtrlHomeHeader2$txtSearch = isbn;
	this.searchRequest.qs.searchtext = isbn;
	return this.searchRequest;
}

ThriftbooksAPI.prototype.setNewAddress = function( firstName, lastName, address, address2, city, state, zip, country, phone ) {
	if(country === 'USA') {
		country = 17;
	}
	
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$txtFirstName = firstName;
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$txtLastName = lastName;
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$txtOrgName = '';
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$txtAddress = address;
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$txtAddress2 = address2;
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$txtCity = city;
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$ddlState = state;
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$txtZip = zip;
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$ddlCountry = country;
	this.addAddressRequest.form.ctl00$ContentPlaceHolder1$txtPhone = phone;
	return this.addAddressRequest;
}

/**
 * Fetches the account info for this account and writes it to disk.
 * @param {object} cookieJar - a cookie jar that is passed through the callback chain to maintain the program's session.
 * @param {object} requestData - the http request passed to thriftbooks in order to fetch the account information.
 * @param {object} callbackFuncs - the array of remaining functions that will be called after this function.
 * @param {object} callbackRequests - the array of remaining requests that correspond to the remaining callback functions. 
 */ 
ThriftbooksAPI.prototype.accountInfo = function(cookieJar, requestData, callbackFuncs, callbackRequests) {
	var self = this;
	requestData.jar = cookieJar;
	console.log("Loading account info...");
	request.get(requestData, function(error, response, body) {
		fs.writeFileSync('results/accountInfo.html', body);
		console.log('load account info response...' + response.statusCode);
		if( !(callbackFuncs[0] === undefined && callbackRequests[0] === undefined) ) {
			var remainingFuncs = callbackFuncs.length - 1;
			var remainingRequests = callbackRequests.length -1;
			callbackFuncs[0](requestData.jar, callbackRequests[0], callbackFuncs.splice(1, remainingFuncs), callbackRequests.splice(1, remainingRequests));
		}
	});
};

/**
 * Adds an address to this account's list of addresses. 
 * @param {object} cookieJar - a cookie jar that is passed through the callback chain to maintain the program's session.
 * @param {object} requestData - the http request passed to thriftbooks in order to add an address
 * @param callbackFuncs - the array of remaining functions that will be called after this function.
 * @param callbackRequests - the array of remaining requests that correspond to the remaining callback functions. 
 */ 
ThriftbooksAPI.prototype.addAddress = function(cookieJar, requestData, callbackFuncs, callbackRequests) {
	var self = this;
	requestData.jar = cookieJar;
	console.log('Adding address...');
	request.post(requestData, function(error, response, body) {
		fs.writeFileSync('results/address.html', body);
		console.log('add address response...' + response.statusCode);
		if( !((callbackFuncs[0] === undefined) && callbackRequests[0] === undefined) ) {
			var remainingFuncs = callbackFuncs.length - 1;
			var remainingRequests = callbackRequests.length -1;
			callbackFuncs[0](requestData.jar, callbackRequests[0], callbackFuncs.splice(1, remainingFuncs), callbackRequests.splice(1, remainingRequests));
		}
	});
};

