/**
 * Logs in to thriftbooks.com and creates a cookie jar that contains the session information for future requests.
 * @param {object} requestData - the http request passed to thriftbooks in order to authenticate
 * @param callbackFuncs - the array of remaining functions that will be called after this function.
 * @param callbackRequests - the array of remaining requests that correspond to the remaining callback functions. 
 */ 
ThriftbooksAPI.prototype.login = function(requestData, callbackFuncs, callbackRequests) {
	var self = this;
	requestData.jar = request.jar();
	request.post(requestData, function(error, response, body) {
	console.log('Logging into website...');
		fs.writeFileSync('results/login.html', body);
		console.log('login response... ' + response.statusCode);
		if( !(callbackFuncs[0] === undefined && callbackRequests[0] === undefined) ) {
			var remainingFuncs = callbackFuncs.length - 1;
			var remainingRequests = callbackRequests.length -1;
			callbackFuncs[0](requestData.jar, callbackRequests[0], callbackFuncs.splice(1, remainingFuncs), callbackRequests.splice(1, remainingRequests));
		}
	});
	
};

/**
 * @param functionChain - the array of remaining functions that will be called after this function.
 * @param requestChain - the array of remaining requests that correspond to the remaining callback functions. 
 */  
ThriftbooksAPI.prototype.runChains = function(functionChain, requestChain) {
	var self = this;
	this.login(this.loginRequest, functionChain, requestChain);
}
	
module.exports = ThriftbooksAPI;

